INSERT INTO ims_lrj_guide_question VALUES 
('28','8','8','4','睡眠品质下降','3','images/8/2016/07/MXcxsbq0uPIaUa06SN6u28qAN666Q0.png','1.上午，雨天，天冷时易会身心失调（身体困乏，情绪出现急躁或抑郁）;\r\n2.腋下体温在36.5℃以下，甚至于36℃以下\r\n','您睡眠质量差,神经协调性不足,会有失眠困扰,建议您多步行,泡热水澡及食用神经I型辅助改善;\r\n您睡眠品质不高,会影响机体的代谢完整,建议多步行,泡热水澡及食用神经I型调理\r\n\r\n','1473745222'),
('29','8','8','6','记忆力减退','3','images/8/2016/07/gQiV3ZmFyyhe78Fs8Qj74qjyQqMqMQ.jpg','1.头部间歇性颤抖;\r\n2.舌头细微颤抖;\r\n3.脸部光滑发亮;\r\n4.唾液异常变多;\r\n5.面无表情（不包括情绪因素）;\r\n6.身体佝偻（躯体老龄化）;\r\n7.肢体动作缓慢，移动慢;\r\n8.手脚颤抖（非紧张情况下）;\r\n9.肌肉僵硬（无劳累前提下）;\r\n10.走路时，双手少摆动，走小碎步，摩擦地面\r\n','您的脑细胞功能受损,阿兹海默症(痴呆症)的风险较高,建议您增加户外活动,食用神经Ⅲ型辅助调理;\r\n您脑细胞活力不足,建议您增加户外活动,食用神经Ⅲ型辅助改善\r\n\r\n','1473745275'),
('30','8','11','1','心窝处在空腹时疼痛','3','images/8/2016/08/ncOvjC8VoOf84FG5G7tuENpxx3OV55.jpg','1.眼睑结膜苍白(出血时);\r\n2.像煤渣般的黑便（食用黑芝麻、黑豆、猪血等除外）\r\n','您胃粘膜受损较深，胃壁龟裂，有胃溃疡、十二指肠溃疡的倾向,建议平时进食多咀嚼，三餐定时，并食用消化I型辅助改善;\r\n您胃粘膜受损，建议平时进食多咀嚼，三餐定时，选用消化I型辅助改善\r\n','1473746153'),
('32','8','8','8','头痛','3','images/8/2016/08/R0Ee3x4Mr8N738sSns044meO0Ief04.jpg','1.喝很多茶，水，咖啡等饮料;\r\n2.腹部(即身体的中心点处)寒冷(表示全身是冷的);\r\n3.尿量较少\r\n','您血管过于收缩与舒张,造成头痛的症状,建议在颈后部做适当按摩及食用循环Ⅱ型辅助改善;\r\n您的脑部血管收缩与舒张功能不佳,建议在颈后部做适当按摩及食用循环Ⅱ型调理\r\n\r\n','1473745397'),
('33','8','8','7','眩晕','3','images/8/2016/08/esRFr1e3Jr1Rx6kxoXlJfRXa6sOa6r.jpg','1.早上起不来，上午身体不舒服等不适感;\r\n2.经常需要吸取水分;\r\n3.很少出汗;\r\n4.排尿量和次数减少;\r\n5.伴有恶心呕吐\r\n','您的循环不畅,脑部供血不足,易晕眩,建议多步行及选用循环Ⅰ型辅助调理;\r\n您的循环功能下降,建议多步行及选用循环Ⅰ型调理\r\n','1473745432'),
('34','8','8','1','眼球明显突出，眼睛发亮','3','images/8/2016/08/UpcHLpAace4JcXCLw7lwsCXS2PWshe.jpeg','1.皮肤柔软细致;\r\n2.手指发抖;\r\n3.甲状腺肿大时，在吞口水同时甲状腺随着移动 \r\n','您的甲状腺素分泌过多,机体代谢不胜负荷,有甲状腺机能亢进症风险,建议平时多步行,先帮助机体改善代谢,减轻甲状腺的分泌,先从消化I型开始调整;\r\n您有甲状腺素分泌过多的倾向,细胞代谢过于旺盛,建议平时多步行,可以从改善代谢入手,协助机体分泌腺的均衡,首先从消化I型入手\r\n\r\n\r\n','1473745503'),
('35','8','8','7','出现黑眼圈，眼皮浮肿并腹部绞痛','3','images/8/2016/08/m685NA520V414ez181NE0Hs8P4z6Pl.jpg','1.口中有尿味或阿摩尼亚（氨气）的臭味（尿毒症或洗肾的人);\r\n2.压往下腹部放手后不会反弹;\r\n3.血尿;\r\n4.下半身比上半身瘦弱\r\n','您的肾脏代谢功能下降,水分代谢障碍,是肾脏病、尿路结石的高危人群,建议选用循环Ⅰ型辅助改善;\r\n您的机体对水分代谢不足,造成过多水分存留,建议选用循环Ⅰ型调理\r\n','1473745539'),
('36','8','8','7','头痛眼胀，眼部分泌物增多','3','images/8/2016/08/fexp99dUOuVp2UUXfu22pX9A2uNUhF.jpg','1.早上起不来,上午身体不舒服等不适感;\r\n 2.经常需要吸取水分;\r\n 3.很少出汗;\r\n 4.排尿量和次数减少;\r\n 5.眼球按压感觉坚硬\r\n','您的眼部循环不畅,眼压会逐步升高,有青光眼的风险,建议平时饮水要适量,不易过多,并选用循环Ⅰ型辅助调理;\r\n你的眼部循环不畅,影响眼压的平衡,建议平时饮水要适量,不易过多并食用循环Ⅰ型辅助调理\r\n\r\n','1473745573'),
('37','8','8','7','耳鸣','3','images/8/2016/08/Woa4Oin8OfZVKvFsFVO4BavAGvfvgc.jpg','1.早上起不来，上午身体不舒服等不适感;\r\n2.经常需要吸取水分;\r\n3.很少出汗;\r\n4.排尿量和次数减少\r\n','您的循环不畅,脑部供血不足,易耳鸣,建议平时多步行,选用循环Ⅰ型辅助调理;\r\n您的循环功能下降,建议平时多步行,选用循环Ⅰ型调理\r\n','1473745604'),
('38','8','8','8','耳垂有皱纹','3','images/8/2016/08/p6MWWEjXEJLA8WDmwE8j1eL61h6X8l.jpg','1.眼睛周围有黄色的疣(胆固醇过多);\r\n2.角膜有白色环;\r\n3.举止僵硬，不灵活;\r\n4.阿基里斯腱（足踝后侧的粗大肌腱组织，俗称脚筋）的宽度超过2公分(正常为0.9cm以内)\r\n','您血管中有较多杂质，血管弹性不足，有动脉硬化的倾向,建议平时饮食清淡，少油少盐，并需要食用循环Ⅱ型辅助改善;\r\n您血管柔韧性下降，建议平时饮食清淡，少油少盐，需要选用循环Ⅱ型辅助改善\r\n','1473745635'),
('39','8','8','5','头部,舌头,手间歇性颤抖','3','images/8/2016/08/M1nlQL7dZ6DNULwWUvQu3dDdR306vD.jpg','1.脸部光滑发亮;\r\n2.唾液异常变多;\r\n3.面无表情(不包括情绪因素);\r\n4.身体佝偻(躯体老龄化);\r\n5.肢体动作缓慢,移动慢;\r\n6.手脚颤抖(非紧张情况下);\r\n7.肌肉僵硬(无劳累前提下);\r\n8.走路时,双手少摆动,走小碎步,摩擦地面\r\n','您的运动神经受损，帕金森症的风险较高，建议做适量的户外日晒，食用神经II型辅助调理;\r\n您的运动神经功能较弱，建议做适量的户外日晒，食用神经II型辅助改善\r\n','1473745723'),
('40','8','8','7','经常脸部泛红','3','images/8/2016/08/cRTTkrtdRg655HdGHRsqRrj6SqRD8J.jpg','1.经常眼皮充血;\r\n2.臀部,大腿的肌肉退化,下半身衰弱无力;\r\n3.收缩压140mmHg以上/舒张压90mmHg以上\r\n','您血管柔软度下降，血液流动受阻，有高血压的倾向,建议多步行，根据自身关节情况做适量的下蹲，食用循环I型辅助改善;\r\n您血管的弹性不佳，血液流动不畅，多关注血压情况，建议多步行，根据自身关节情况做适量的下蹲，选用循环I型辅助改善\r\n','1473745752'),
('41','8','8','8','脸色、嘴唇、舌头、指甲苍白','3','images/8/2016/08/cfUnRR3pnyfNdMDdzPD55r33ymrmnC.jpg','1.舌头光滑---恶性贫血(VB12或叶酸不足);\r\n2.指甲苍白，易裂或凹陷或汤匙状---缺铁性贫血\r\n','您造血功能障碍，红细胞数量不足，有贫血的倾向,建议食用循环Ⅱ型+免疫Ⅰ型辅助改善，您可以先从循环II型作为健康改善第一站;\r\n您的造血功能不佳，建议选用循环Ⅱ型+免疫Ⅰ型辅助改善，从循环II型开始可作为您健康改善的第一站\r\n\r\n\r\n','1473745782'),
('42','8','8','8','嘴歪、单侧手脚麻木','3','images/8/2016/08/DH75SwEEhW497S45wS4L94whB7Y4ps.jpg','1.无法皱眉头;\r\n2.一侧眼皮下垂，无法完全闭合，单边瞳孔放大(似中脑膜动脉出血);\r\n3.口齿不清;\r\n4.口舌歪斜;\r\n5.臀部和大腿肌肉退化，下半身无力\r\n','您脑部供血供氧不足，血管硬化，有脑中风的迹象,建议平时饮食清淡，少油少盐，食用循环Ⅱ型辅助改善;\r\n您脑部供血供氧不足，血液流动不畅，建议平时饮食清淡，少油少盐，选用循环Ⅱ型辅助改善\r\n','1473745807'),
('43','8','8','2','口渴、常喝水、嘴唇干燥','3','images/8/2016/08/OwqkV578W7q1q8KyuI7QWzwqwk0zwK.jpg','1.口中会发出如水果腐烂臭味(病情重时);\r\n2.腮腺肿大(代偿性机能亢进---发挥胰脏功能);\r\n3.容易发生感冒，支气管炎(免疫力下降);\r\n4.皮肤发痒(特别在阴部);\r\n5.多尿，糖尿，性无能 ;\r\n6.下半身较瘦弱无力;\r\n7.下肢麻痺\r\n','您血糖平衡功能不足，有糖尿病风险,平时少吃甜食，为了帮助机体血糖均衡，可以先从其根源--消化代谢入手，建议您选择消化II型辅助改善; \r\n您有血糖功能平衡不足的倾向，其根源的第一步来源于消化功能的不足，建议平时少吃甜食，选用消化II型辅助改善\r\n\r\n','1473745838'),
('44','8','10','6','肩颈僵硬','3','images/8/2016/08/ZnuK4n2GzkJBkLnKkkUBbKnEgnKGIE.jpg','1.喝很多茶,水,咖啡等饮料l\r\n 2.腹部(即身体的中心点处)寒冷(表示全身是冷的);\r\n 3.尿量较少\r\n','您的神经系统过于紧绷，循环不畅，肩颈堆积过多的酸性物质，建议同一姿势不要超过30分钟，食用神经Ⅲ型辅助改善;\r\n您的肩部附近肌肉紧绷，循环不畅，建议一姿势不要超过30分钟，并用食用神经Ⅲ型调理\r\n','1473745866'),
('45','8','9','11','咳嗽、多痰','3','images/8/2016/08/nWeF95goW5Lo9OZLFsVsZ8o8of9u5O.jpeg','1.耳朵后面头部的淋巴结肿大（感冒等病毒引起的发炎）;\r\n 2.头部前侧的淋巴结肿大（细菌引起的发炎）\r\n','您的气管粘膜受到病菌侵犯，气管受阻，易有支气管炎，建议食用免疫Ⅱ型辅助改善;\r\n您的气道功能不佳，防御系统功能受损，建议食用免疫Ⅱ型调理\r\n\r\n','1473745892'),
