('48','8','9','7','心跳过快','3','images/8/2016/08/gjg32mb3dR5u65S335vRS5mgJJmd2Z.jpg','1.茶，水，咖啡等水分摄取很多;\r\n2.舌头上水分很多，舌头边缘有牙齿痕状;\r\n3.发生在安静时分(副交感神经旺时);\r\n4.腹部有进水声;\r\n5.腹部寒冷;\r\n6.下腹部，下半身肥胖;\r\n7.排尿次数或排尿量较少(正常平均7~8次/天，共1500cc)\r\n','您心脏收缩、舒张功能不足，跳动稳定性不足，建议注意作息规律并食用循环Ⅰ型辅助改善;\r\n您心脏收缩、舒张功能不佳，建议平时注意作息，并选用循环Ⅰ型调理\r\n','1473746025'),
('49','8','9','7','心律不整(时快时慢)','3','images/8/2016/08/JzD8KFbWFLBK4IwKikdR4By69VSEWW.jpg','1.茶，水，咖啡等水分摄取很多;\r\n2.舌头上水分很多，舌头边缘有牙齿痕状;\r\n3.发生在安静时分(副交感神经旺时);\r\n4.腹部有进水声;\r\n5.腹部寒冷;\r\n6.下腹部，下半身肥胖;\r\n7.排尿次数或排尿量较少(正常平均7~8次/天，共1500cc);\r\n8.疲劳或精神紧张时症状加重\r\n','您心脏收缩、舒张能力下降，造成不正常，脉搏节律,建议食用循环Ⅰ型辅助改善;\r\n您心脏收缩、舒张能力下降不足，建议选用循环Ⅰ型调理\r\n','1473746048'),
('50','8','9','7','心悸(心跳过快并心慌)','3','images/8/2016/08/PjTQAM4ssJCtA5d1AID1vT1IDc1dMy.jpg','1.茶，水，咖啡等水分摄取很多;\r\n2.舌头上水分很多，舌头边缘有牙齿痕状;\r\n3.发生在安静时分(副交感神经旺时);\r\n4.腹部有进水声;\r\n5.腹部寒冷;\r\n6.下腹部，下半身肥胖;\r\n7.排尿次数或排尿量较少(正常平均7~8次/天，共1500cc);\r\n8.疲劳时更加明显\r\n','您心脏的收缩、舒张功能下降，影响心脏跳动节律,建议食用循环Ⅰ型辅助改善;\r\n您心脏收缩、舒张功能不佳，建议选用循环Ⅰ型调理\r\n\r\n','1473746103'),
('51','8','9','11','胸部寒冷并下腹部寒冷','2','images/8/2016/08/NVOFVhAZpphGg94PiCaooRpa9vIvgL.jpg','1,腹部向前方突出','您内分泌功能失衡，细胞可能会出现变异，有乳癌、卵巢癌或是子宫内膜癌的倾向，建议在相关医疗检查与治疗同时，您平时做扩胸运动，并食用免疫Ⅱ型辅助改善\r\n您内分泌失调，循环不畅，会进一步影响机体的代谢正常化，建议您在相关医疗检查与治疗同时，多做扩胸运动，并食用免疫Ⅱ型调理\r\n','1473748613'),
('52','8','11','1','右上腹不适','3','images/8/2016/08/mFc1rCW4iVIz3TRl4ff50Fcvvf3Vl0.jpg','1.严重时出现黄疸(眼白变黄);\r\n2.恶心，呕吐;\r\n3.平时感到腹部冰冷;\r\n4.发烧（提示有胆囊炎）\r\n','您胆汁分泌异常，有胆结石、胆囊炎的倾向,建议平时少吃油腻食物，并选用消化I型辅助改善;\r\n您肝胆功能不佳，建议平时少吃油腻食物，选用消化I型辅助改善\r\n','1473746352'),
('53','8','11','1','吃较多油腻食物','3','images/8/2016/08/NjjDJ11SDbY8UvT0PDxSyUzJBzuT0X.jpg','1.易疲劳，体力下降;\r\n2.口味比较重;\r\n3.胸部、肋骨处不适，不想束皮带或其他衣物;\r\n4.视物模糊\r\n','您肝功能下降，有脂肪肝的倾向,建议规律作息，并食用消化I型调理;\r\n您肝脏处理脂肪负担过重，建议规律作息，并选用消化I型调理\r\n\r\n','1473746666'),
('54','8','11','1','腹痛、腹泻','3','images/8/2016/08/kbEb6y663mBmkmeQOmQy8YBiqYO3YY.jpg','1.心窝处;\r\n2.右上腹;\r\n3.左上腹;\r\n4.右中腹;\r\n5.左中腹;\r\n6.小腹部(肚脐附近);\r\n7.下腹部\r\n','您的消化代谢工作未能完善，胃肠功能有待整理与修复，建议食用消化I型辅助调理;\r\n您的消化、分解、吸收及代谢有障碍，建议食用消化Ⅰ型辅助调理 \r\n\r\n','1473746807'),
('55','8','11','1','易饱胀、反酸','3','images/8/2016/08/GUgL2122t8T2p662428U2FHT82ub87.jpg','1.心窝部位不适;\r\n2.过冷、过硬、辛辣食物会引起不适\r\n','您胃粘膜已受损，胃功能障碍，有胃炎的倾向,建议平时饮食多咀嚼，并食用消化I型调理;\r\n您胃粘膜有受损，建议平时饮食多咀嚼，并选用消化I型调理\r\n','1473746862'),
('56','8','11','4','提重物时，背部和腰部会酸疼','3','images/8/2016/08/dknHQv3VViQzBoOkdOpov3wNB3oiko.jpeg','1.久坐时，背部腰部会疼;\r\n2.屁股着地，腰骨轻易骨折\r\n','您的骨质中有机钙含量偏低，可能有骨质疏松的风险,其根源与神经系统密切相关，建议平时做适量的日晒，并食用神经I型调理;\r\n您有骨质有机钙含量需要提升，而且循环也需要提升,建议平时做适量的日晒，并从代谢的根源入手，可选用神经I型调理\r\n\r\n\r\n','1473746897'),
('57','8','12','9','月经品质不佳','2','images/8/2016/08/KeClwmB4gJYW5474HWEk5jchcwhCw4.jpg','1. 烦躁，心绪不安，焦虑，失眠;\r\n2.出疹子，发红，流汗;\r\n3.恶心，咳嗽，口腔炎;\r\n4. 喉咙阻塞;\r\n5. 肩膀僵硬;\r\n6. 呼吸困难，心悸;\r\n7. 下半身体温降低，若此现象一久时，上半身体温上升;\r\n8. 下腹部冰冷;\r\n9. 便祕，排尿困难，膀胱无力;\r\n','您有内分泌水平失衡，影响每月的“阴晴圆缺”，干扰机体其他器官的正常运作秩序,其根源与神经系统、循环系统密切相关。您可以先从神经系统I型开始调整，后续加以循环III型改善;\r\n您有内分泌腺体分泌失衡，影响每月的“阴晴圆缺”,其根源与神经系统、循环系统密切相关。您可以先从神经系统I型开始调整，后续加以循环III型改善。\r\n','1473748553'),
('58','8','12','7','频尿(1):排尿时疼痛','3','images/8/2016/08/A36Rw9WMWWrWMMxZ6Z7GgwWgWWxW65.jpg','1.发烧;\r\n2.平常时下腹部冰冷;\r\n3.腰痛;\r\n4.血尿\r\n','您的泌尿系统“防御”出现障碍，有病菌侵犯入机体，有膀胱炎、肾盂肾炎的风险，为改善机体的水循环，增强泌尿系统防御能力，建议适当增加水分摄入，并选用循环Ⅰ型辅助改善;\r\n您的泌尿系统的“防御”出现障碍，病菌已侵犯粘膜组织，调理可从改善水循环，增强泌尿系统粘膜防御能力入手，建议适当增加水分摄入，并选用循环Ⅰ型作辅助改善\r\n\r\n','1473746935'),
('59','8','12','9','生理痛','2','images/8/2016/08/B276hj1o9ZNfiof7Np79Zr7FuUou6z.jpg','1. 烦躁，心绪不安，焦虑，失眠;\r\n2. 出疹子，发红，流汗;\r\n3. 恶心，咳嗽，口腔炎;\r\n4. 喉咙阻塞;\r\n5. 肩膀僵硬;\r\n6. 呼吸困难，心悸;\r\n7. 下半身体温降低，若此现象一久时，上半身体温上升;\r\n8. 下腹部冰冷;\r\n9. 便祕，月经不顺，排尿困难，膀胱无力;\r\n10.腰部、下腹部坠胀\r\n','您有内分泌失衡，盆腔循环不畅，造成生理痛,建议尽量避免冰冷食物，并食用循环III型调理\r\n您有内分泌不均衡，盆腔的循环欠佳,建议尽量避免冰冷食物，食用循环III型调理','1473748672'),
('60','8','12','4','更年期障碍','2','images/8/2016/08/h5sSUxomsWJXC6ZU0jXCjjXS64F0Wx.jpg',' 1.烦躁，心绪不安，焦虑，失眠症状明显;\r\n2. 出疹子，发红，流汗;\r\n3. 恶心，咳嗽，口腔炎;\r\n4. 喉咙阻塞;\r\n5. 肩膀僵硬;\r\n6. 呼吸困难，心悸;\r\n7. 下半身体温降低，若此现象一久时，上半身体温上升;\r\n8. 下腹部冰冷;\r\n9. 便祕，月经不顺，排尿困难，膀胱无力\r\n','您的内分泌水平在逐步下降过程中出现不均衡状态，拖累其他器官的代谢秩序,其根源与神经系统、循环系统功能下滑直接关联，可先选用神经I型作辅助改善的开始，其后用循环II型作为二期调理;\r\n您内分泌不均衡，未来会出现机体的其他器官运作异常,其根源与神经系统、循环系统功能下滑密切相关，建议从根源入手，先选用神经I型作辅助改善\r\n','1473748725'),
('61','8','12','1','腹部向前方突出,下腹部寒冷','2','images/8/2016/08/r6S0BcwB9jjsUx5YUg6GzJ96kKcTTy.jpg','1.腹部向下方突出','您的子宫或卵巢细胞代谢秩序异常，是卵巢囊肿和子宫肌瘤的高危人群，其根源为体质的酸化开始。建议先从代谢入手，选用消化I型辅助调理;\r\n您是普通肥胖，建议参考肥胖来进行调理','1473748762'),
('62','8','12','8','频尿(2):量增加,次数增加','3','images/8/2016/08/G8Q3Qcq8R6J8CxCMkjqc6936JMrZCq.jpg','1.口中会发出如水果腐烂臭味(病情重时);\r\n2.腮腺肿大(代偿性机能亢进---发挥胰脏功能);\r\n3.容易发生感冒，支气管炎(免疫力下降);\r\n4.皮肤发痒(特别在阴部);\r\n5.性功能明显下降;\r\n6.下半身较瘦弱无力;\r\n7.下肢麻痺\r\n','您的前列腺功能下降，易患前列腺疾病，其根源与循环减慢密切相关，建议避免久坐，并选用循环II型辅助改善;\r\n您的前列腺功能欠佳，其来源与循环功能不足相关，建议您避免久坐，同时选用循环II型辅助调理\r\n\r\n','1473747067'),
('63','8','12','2','频尿(3):膀胱无力','1','images/8/2016/08/f2WcX9N4xvNFf2jnfsc9tFzW39vbXZ.jpg','1.老花眼，眼睛疲倦;\r\n2.重听，耳鸣;\r\n3.牙齿不好;\r\n4.下半身肌肉衰退，下半身虚弱（肾虚）;\r\n5.小腿抽筋\r\n','您血糖平衡功能不足，有糖尿病风险,为了帮助机体血糖均衡，平时避免甜食，可以先从其根源--消化代谢入手，建议您选择消化II型辅助改善; \r\n您有血糖功能平衡不足的倾向，其根源的第一步来源于消化功能的不足，建议避免甜食，并选用消化II型辅助改善 \r\n\r\n','1473747141'),
('64','8','12','12','夜间频尿','3','images/8/2016/08/j5burSpi932vkKB0lKTIz9FxKL9RBM.jpg',' 1.老花眼，眼睛疲劳;\r\n 2.重听，耳鸣;\r\n 3.牙齿不好;\r\n 4.下半身肌肉衰退，下半身虚弱（肾虚）;\r\n 5.频尿，膀胱无力;\r\n 6.小腿抽筋\r\n','您机体细胞在老化，免疫Ⅲ型有助于您的精力提升，您选用来作为辅助改善,同时可根据自身的体能状况增加步行;\r\n您机体细胞代谢在减慢，机体精力不断老化，建议您根据自身体能状况多步行，同时需要免疫Ⅲ型调理\r\n\r\n\r\n','1473747254'),
('65','8','12','3','排便品质差(干结、排便时间长等)','3','images/8/2016/08/ICFDcCNYw5W8R848Sys9ss95899csd.jpg','1.喜欢食用如水/牛奶/面包/蛋糕/生菜/南方水果等让身体变冷的阴性食物;\r\n2.腹部，特别是肚腩下方是冰冷的;\r\n3.腹部肌肉衰弱\r\n','您的消化系统分解、吸收、排泄功能不完整，造成便秘,建议避免辛辣，并食用消化Ⅲ型调理;\r\n您的胃肠蠕动能力不足，建议平时避免辛辣，同时食用消化Ⅲ型调理\r\n\r\n','1473747287'),
('66','8','13','7','下肢浮肿','3','images/8/2016/08/rbARWPGls6pZGKg4m6jW6dWAGvgP7P.jpg','1.体重每天增加数百克约1Kg;\r\n2.严重时出现气喘，粉红色泡沫状痰(肺水肿);\r\n3.夜间排尿次数增多;\r\n4.尿量变少;\r\n5.上半身坐起比平躺的姿势舒服\r\n','您心脏泵血功能减弱，体内堆积多余水分，有心脏衰竭的倾向,建议饮食清淡，少油少盐，并食用循环Ⅰ型辅助改善;\r\n您心脏泵血功能减弱，建议平时饮食清淡，少油少盐，并选用循环Ⅰ型辅助改善\r\n\r\n','1473747355'),
('67','8','13','2','下肢浮肿，皮肤冰冷并粗糙','3','images/8/2016/08/U6AHYC3171713z66cS38ypwX33KhW3.jpg','1. 眼皮微肿，尾毛外侧1/3变薄;\r\n2.舌头变大;\r\n3.甲状腺肿大时，在吞口水同时甲状腺随着移动 \r\n','您的甲状腺素分泌不足，机体代谢缓慢，有甲状腺机能低下症风险,其根源来于消化代谢不足，建议根据自身体能状况多步行，并食用消化Ⅱ型作辅助改善;\r\n您有甲状腺素分泌减少，影响的机体的代谢，其根源来于消化功能不完整，建议根据自身体能状况多步行，并选用消化Ⅱ型作辅助改善 \r\n\r\n','1473747527'),
('68','8','13','11','关节疼痛','3','images/8/2016/08/ZoFnuAeEdEYBu1NoqOuOeyyn1ZuBO9.jpg','1.喝很多茶，水，咖啡等饮料;\r\n2.腹部（即身体的中心点处）寒冷（表示全身是冷的）;\r\n3.尿量较少;\r\n4.关节红肿\r\n','您的免疫细胞功能障碍，对关节细胞产生自身“攻击”，关节功能受损，有风湿痛的风险，建议您尽量减少身体负重，并食用免疫II型辅助调理;\r\n您的免疫系统细胞自身辨别能力有障碍，或循环不畅，造成关节功能受损，建议您尽量减少身体负重，并食用免疫II型辅助改善\r\n\r\n\r\n','1473747560'),
('69','8','13','1','脚拇指发红,剧痛,肿大','3','images/8/2016/08/yd7k7WD4J4Xj4I1fYjIRi4oIJX4E45.jpg','1.沿耳垂软骨出现肿疱---痛风结节(形为慢性化);\r\n2.疼痛处温度较低(低于25ﾟC)\r\n','您机体对尿酸代谢不完整，造成尿酸存留，有痛风的倾向,其根源为消化功能不足，建议饮食清淡，避免高蛋白，同时食用消化I型辅助改善;\r\n您的机体对尿酸代谢能力下降，为了提升您的代谢功能，建议平时饮食清淡，避免高蛋白，同时选用消化I型辅助改善\r\n\r\n','1473747602'),
('70','8','13','6','肌肉酸痛','3','images/8/2016/08/R61NNSy71tEwnrtSiwnaW26erEciRn.jpg',' 1.喝很多茶,水,咖啡等饮料;\r\n 2.腹部(即身体的中心点处)寒冷(表示全身是冷的);\r\n 3.尿量较少\r\n','您的神经系统过于紧绷，循环不畅，肌肉堆积过多的酸性物质，建议注意规律作息，同时需要食用神经Ⅲ型辅助改善;\r\n您的肌肉紧绷，循环减慢，建议注意作息规律，并食用神经Ⅲ型调理\r\n','1473748060'),
('71','8','14','4','情绪不稳定(对事对人容易敏感)','3','images/8/2016/08/fTO9cn949O9zC9zb9bOk46eZkZb1T9.jpeg','1.腋下体温在36.5℃以下，甚至于36℃以下','您神经系统稳定性不足，有抑郁、自律神经失调的风险，建议您根据自身体能状况多步行，并食用神经I型辅助改善;\r\n您神经系统稳定性稍弱，建议您根据自身体能状况多步行，并食用神经I型辅助改善。\r\n\r\n','1473748087'),
('72','8','14','1','黄疸(眼睑、皮肤暗黄)','3','images/8/2016/08/DkVkZwyXsw0oj0b2BsJ0oqPsW4sWqg.jpg','1.脸部，手臂出现褐斑;\r\n2.慢性肝功能障碍---海绵状血管瘤(脸部或胸部出现如海绵般红色印记);\r\n3.手掌红斑(手掌发红)\r\n','您肝功能异常，肝细胞已经受损，有肝炎的倾向,建议平时少吃肉类，规律作息同时选用消化I型辅助改善;\r\n您肝胆功能不佳，肝细胞部分受损，建议注意作息，少吃肉类，选用消化I型辅助改善\r\n\r\n','1473748118'),
('73','8','14','6','神经痛(喝水、茶、咖啡多，尿少)','3','images/8/2016/08/p5RffK4cWVRcKFfnkw9XWchkDTnXt6.jpg','1.腹部(即身体的中点处)寒冷(表示全身是冷的)','您水循环障碍，造成神经系统的反应，有神经痛的倾向，建议您平时避免冰凉食物，选用神经III型辅助调理;\r\n您水循环不足，造成神经系统不适，建议您平时避免冰凉食物，选用神经III型改善\r\n','1473748165'),
('74','8','14','12','易过敏(常喝水，但尿少、汗少)','3','images/8/2016/08/xzzvNv02927C9iNUcNKL96vCh7qvZn.jpg','1.舌头较厚，舌头边缘呈齿痕，舌头表面水分多;\r\n2.腋下体温于36.5℃以下（甚至或在35℃以下）;\r\n3.腹部冰凉，腹部时有水振声\r\n','您免疫细胞功能受损，造成自身细胞相互“攻击”，有过敏性疾病的倾向，建议您规律作息，避免熬夜，选用用免疫Ⅲ型作辅助调理;\r\n您免疫细胞的稳定性不足，造成过敏，建议您规律作息，避免熬夜食用免疫Ⅲ型辅助调理\r\n','1473748192'),
('75','8','14','11','发烧','3','images/8/2016/08/y79itrNa72XNdyhiaH09x9Hc9kz99y.jpg','1.身体---特别是颈部到背部 ---会觉得寒冷;\r\n2.身体会发抖(抖动肌肉以促进发烧的反应);\r\n3.发冷，疲倦，饮食过量等情况会一直持续\r\n','您有发烧的现象，机体免疫细胞正进行“抗争”，建议您多喝水，同时食用免疫Ⅱ型调理改善;\r\n您免疫功能不足，建议多喝水，同时食用免疫Ⅱ型\r\n','1473748219'),
('76','8','14','10','易感冒','3','images/8/2016/08/vO0c5hJSm7WsmOMV74S004J2Vs0gQc.jpg','1.耳朵后面头部的淋巴结肿大(感冒等病毒引起的发炎);\r\n 2.头部前侧的淋巴结肿大(细菌引起的发炎);\r\n 3.流鼻涕(流鼻水);\r\n 4.头痛;\r\n 5.发热\r\n','您的呼吸道受到感染，建议您适量增加水分摄入，食用免疫I型辅助改善;\r\n您的呼吸系统防御功能不佳，建议您适量增加水分摄入，选用免疫I型系统调理','1473748275'),
